return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2023-03-13 15:40:00+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Plugins - Translate WordPress with GTranslate - Stable (latest release)','language'=>'ru','messages'=>['We try to help everyone as time permits.'=>'Мы стараемся помочь всем, пока позволяет время.','WordPress Forum Support'=>'Поддержка на форуме WordPress','Forum Support (free)'=>'Поддержка на форуме (бесплатно)','Live Chat (for paid plans and pre-sales questions)'=>'Чат (для платных тарифных планов и предпродажных вопросов)','Wrapper selector CSS can be used to render the language selector inside matching elements.'=>'CSS селектора оболочки можно использовать для отображения селектора языка внутри соответствующих элементов.','Language codes for lang attribute are case sensitive. The full list can be found on <a href="https://gtranslate.io/supported-languages" target="_blank" rel="noreferrer">https://gtranslate.io/supported-languages</a>'=>'Коды языков для атрибута lang чувствительны к регистру. Полный список можно найти на <a href="https://gtranslate.io/supported-languages" target="_blank" rel="noreferrer">https://gtranslate.io/supported-languages</a>.','Valid values for widget_look attribute are <b>flags</b>, <b>flags_code</b>, <b>flags_name</b>, <b>lang_codes</b>, <b>lang_names</b>.'=>'Допустимые значения атрибута widget_look: <b>flags</b>, <b>flags_code</b>, <b>flags_name</b>, <b>lang_codes</b>, <b>lang_names</b>.','It is mainly used to easily place individual language links inside menu items. For example you can create a menu item with URL = #, Navigation Label = Spanish and Description = <code>[gt-link lang="es" label="Spanish" widget_look="flags_name"]</code> and a single menu item will appear to change the language to Spanish.'=>'Он в основном используется для простого размещения ссылок на отдельные языки внутри пунктов меню. Например, вы можете создать пункт меню с URL = #, меткой навигации = испанский и описанием = <code>[gt-link lang="es" label="испанский" widget_look="flags_name"]</code> и одним появится пункт меню, чтобы изменить язык на испанский.','<code>[gt-link lang="en" label="English" widget_look="flags_name"]</code> shortcode can be used to render individual language links.'=>'Шорткод <code>[gt-link lang="en" label="English" widget_look="flags_name"]</code> может использоваться для отображения ссылок на отдельных языках.','You can use additional widget_look attribute to place a specific selector, for example <code>[gtranslate widget_look="popup"]</code>. Valid values are <b>float</b>, <b>dropdown_with_flags</b>, <b>popup</b>, <b>dropdown</b>, <b>flags</b>, <b>flags_dropdown</b>, <b>flags_name</b>, <b>flags_code</b>, <b>lang_names</b>, <b>lang_codes</b>, <b>globe</b>.'=>'Вы можете использовать дополнительный атрибут widget_look для размещения определенного селектора, например, <code>[gtranslate widget_look="popup"]</code>. Допустимые значения: <b>float</b>, <b>dropdown_with_flags</b>, <b>popup</b>, <b>dropdown</b>, <b>flags</b>, <b>flags_dropdown</b>, <b>flags_name</b>, <b>flags_code</b>, <b>lang_names</b>, <b>lang_codes</b>, <b>globe</b>.','In theme files you can call <code>echo do_shortcode(\'[gtranslate]\');</code> in PHP context.'=>'В файлах темы вы можете вызвать <code>echo do_shortcode(\'[gtranslate]\');</code> в контексте PHP.','You can use <code>[gtranslate]</code> inside posts, menu items or anywhere else.'=>'Вы можете использовать <code>[gtranslate]</code> внутри сообщений, пунктов меню или где-либо еще.','<code>[gtranslate]</code> shortcode can be used anywhere on your website.'=>'Шорткод <code>[gtranslate]</code> можно использовать в любом месте вашего сайта.','You can use GTranslate Widget in any pre-defined widget locations.'=>'Вы можете использовать GTranslate Widget в любых предопределенных местах расположения виджетов.','Show floating language selector option is the easiest and suitable for most websites.'=>'Параметр «Показать плавающий выбор языка» является самым простым и подходит для большинства веб-сайтов.','Language selector positioning tips'=>'Советы по расположению селектора языка','Globe color'=>'Цвет глобуса','Hide current language:'=>'Скрыть текущий язык:','Custom CSS'=>'Пользовательские CSS','Globe size'=>'Размер глобуса','Bottom'=>'Снизу','Top'=>'Сверху','Right'=>'Справа','Left'=>'Слева','Open direction'=>'Открытое направление','If you are not using this option make sure it is empty or has the default value to not have additional unused code on your front-end. Default value for Wrapper Selector is <code>.gtranslate_wrapper</code>'=>'Если вы не используете эту опцию, убедитесь, что она пуста или имеет значение по умолчанию, чтобы не было дополнительного неиспользуемого кода на вашем внешнем интерфейсе. Значение по умолчанию для селектора оболочки: <code>.gtranslate_wrapper</code>.','If you want the language selector to appear inside a particular HTML element on your page then this option is for you. You simply need to write a CSS selector to point to that HTML element and GTranslate will appear inside of it.'=>'Если вы хотите, чтобы селектор языка отображался внутри определенного HTML-элемента на вашей странице, тогда этот вариант для вас. Вам просто нужно написать селектор CSS, чтобы указать на этот элемент HTML, и GTranslate появится внутри него.','Wrapper selector CSS'=>'CSS селектор обёртки','Show floating language selector option is the easiest and suitable for most websites. It is best for <b>Float</b>, <b>Nice dropdown with flags</b>, <b>Popup</b>, <b>Globe</b> widget looks.'=>'Параметр «Показать плавающий выбор языка» является самым простым и подходит для большинства веб-сайтов. Лучше всего подходит для виджетов <b>Float</b>, <b>Красивое выпадающее меню с флажками</b>, <b>Всплывающее окно</b>, <b>Глобус</b>.','Other looks most likely will require additional CSS rules to match your theme design.'=>'Другие виды, скорее всего, потребуют дополнительных правил CSS, чтобы соответствовать дизайну вашей темы.','Show in menu option is best for <b>Flags</b>, <b>Flags with language name</b>, <b>Flags with language code</b>, <b>Language names</b>, <b>Language codes</b> widget looks.'=>'Параметр «Показать в меню» лучше всего подходит для <b>Флагов</b>, <b>Флагов с названием языка</b>, <b>Флагов с кодом языка</b>, <b>Названия языков</b>, Внешний вид виджета <b>Коды языков</b>.','Select language label'=>'Выберите этикетку языка','Enable CDN'=>'Включить CDN','Native language names'=>'Названия на родном языке','Float'=>'Плавающий','Edit config.php'=>'Изменить config.php','Translation debug mode is ON.'=>'Режим отладки перевода включен.','View debug.txt'=>'Посмотреть файл отладки.txt','Please note that sensitive information can be written into gtranslate/url_addon/debug.txt file, which can be accessed publicly. It is your responsibility to deny public access to it and clean debug information after you are done.'=>'Обратите внимание, что конфиденциальная информация может быть записана в файл gtranslate/url_addon/debug.txt, доступ к которому открыт для всех. Вы обязаны запретить публичный доступ к нему и очистить отладочную информацию после того, как закончите.','Email translation debug mode is ON.'=>'Режим отладки перевода электронной почты включен.','Translate your website and make it multilingual. For support visit <a href="https://wordpress.org/support/plugin/gtranslate">GTranslate Support Forum</a>.'=>'Переведите свой сайт и сделайте его многоязычным. Для получения поддержки посетите <a href="https://wordpress.org/support/plugin/gtranslate">форум поддержки GTranslate</a>.','Flag style'=>'Стиль флага','Detect browser language'=>'Определение языка браузера','Synchronize custom domains with GTranslate dashboard: https://my.gtranslate.io'=>'Синхронизация пользовательских доменов с панелью управления GTranslate: https://my.gtranslate.io','Domain'=>'Дом